fmData)\n\n        # ===== densify =====\n        DENSIFY_RESULTS_PATH = 'results_densify'\n        #   step 1: form image dict\n        img_dict = dict()\n        for i in range(len(loader)):\n            img_dict[i] = loader.get_image(i)\n        #   step 2: call densify\n        mvsnet = MVSNets()\n        dense_points = mvsnet.densify(images=img_dict, sfm_result=sfm_result, save_output=False, output_path=DENSIFY_RESULTS_PATH)\n\n        logger.debug(f\"[Densify] Output dense point cloud volume:{dense_points.shape}\")\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"data":{"bandwidth":[179164102.92782098,5360942.361447604],"bandwidth-half":[89582051.46391049,2680471.180723802],"bandwidth_text":["170.86 MiB","5.11 MiB"],"type":["numpy.ndarray","gtsfm.common.image.Image"]},"selected":{"id":"1288"},"selection_policy":{"id":"1289"}},"id":"1177","type":"ColumnDataSource"},{"attributes":{},"id":"1227","type":"AllLabels"},{"attributes":{},"id":"1124","type":"BasicTicker"},{"attributes":{"child":{"id":"1073"},"title":"Worker Profile (administrative)"},"id":"1212","type":"Panel"},{"attributes":{"axis":{"id":"1123"},"dimension":1,"ticker":null},"id":"1126","type":"Grid"},{"attributes":{},"id":"1229","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1215","type":"Panel"},{"attributes":{"formatter":{"id":"1229"},"major_label_policy":{"id":"1227"},"ticker":{"id":"1120"}},"id":"1119","type":"DatetimeAxis"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1204","type":"AdaptiveTicker"},{"attributes":{"axis":{"id":"1119"},"ticker":null,"visible":false},"id":"1122","type":"Grid"},{"attributes":{"format":"0.0 b"},"id":"1172","type":"NumeralTickFormatter"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1262"},{"id":"1263"},{"id":"1264"},{"id":"1265"},{"id":"1266"},{"id":"1267"},{"id":"1268"},{"id":"1269"},{"id":"1270"},{"id":"1271"},{"id":"1272"
